    "2016-03-10T06:38:33.628234",nt"name": "hydrography-water-resources",nt"isopen":
    false,nt"url": null,nt"notes": "A Water Resource is a DEP primary facility
    type related to the Water Use Planning Program. The sub-facility types related to
    Water Resources that are included are:____ Discharge: A Discharge subfacility type
    represents the return of water used at a Water Resources primary facility. The subfacility
    type may be a sewage treatment plant, instream discharge, spray irrigation field,
    groundwater recharge, on-lot septic or an unidentified facility type. Ground Water
    Withdrawal: A Ground Water subfacility type represents the withdrawal of water used
    at a Water Resources primary facility. The subfacility type may be a well, spring,
    quarry, infiltration gallery, deep mine, surface mine or an unidentified facility
    type. Interconnection: An Interconnection subfacility type represents the point
    of interconnection between Water Resources primary facilities. The subfacility type
    may be for an interconnection between two public water supply agencies or between
    a public water supply agency and a commercial or industrial water user. Storage:
    A Storage subfacility type represents the storage of water used at a Water Resources
    primary facility. The subfacility type represents raw or treated water storage and
    may be a quarry, standpipe, open off-stream reservoir, closed off-stream reservoir,
    instream reservoir, hydroelectric dam, natural lake, pond, silt dam, hydroelectric
    pumped storage or an unidentified facility type. Surface Water Withdrawal: A Surface
    Water subfacility type represents the withdrawal of water used at a Water Resources
    primary facility. The subfacility type may be an instream diversion, intake from
    a dam, natural lake, pond, river well, or an unidentified facility type. Water Allocation:
    A Water Allocation subfacility type represents a permit issued for a surface water
    withdrawal by a Water Resources Public Water Supply (PWS) Agency primary facility.
    The subfacility type (permit) may be issued for all PWS Water Resources' surface
    water withdrawals, ground water withdrawals except ground water wells, or interconnections
    used by a receiving PWS from a surface water PWS. Primary facility kinds, 'Water
    Purveyor' and 'Electric Use', are removed.",nt"license_title": null,nt"extras":
